import React from "react";

function Square(props) {
  const { rowPosition, columnPosition, robotLocation, targetLocation } = props;

  const currentPosition = [rowPosition, columnPosition];

  if (currentPosition.equals(robotLocation)) {
    return (
      <>
        <td>Robot</td>
      </>
    );
  } else if (currentPosition.equals(targetLocation)) {
    return (
      <>
        <td>Target</td>
      </>
    );
  } else {
    return (
      <>
        <td>Square</td>
      </>
    );
  }
}

export default Square;
